import React, { Fragment } from "react";

class TableHeaderFrag extends React.Component {
  render() {
    return (
      <Fragment>
        <th>Name</th>
        <th>Occupation</th>
      </Fragment>
    );
  }
}
export default TableHeaderFrag;
